import React from "react"
import {TopHeader} from "./TopHeader"
import {withTranslation} from '../../../../i18n'

const TopHeaderContainer = (props) => {
    const {t} = props;
    return (
        <TopHeader t={t}/>
    )
};

export default withTranslation('header')(TopHeaderContainer)
